import React from 'react';
import styled from 'styled-components';

const Wrapper = styled.div`
  
`;

const Gather = (props) => { // N개의 독서 모임
  return (
    <>
      <Wrapper>
        <div className="gatherTop">
          <h2>N개의 독서 모임, 마진 탑 100px</h2>
          <h2>모집중, 오른쪽</h2>
          <h2>최신순, 오른쪽 끝 정렬</h2>
        </div>
      </Wrapper>
      
      <h4>이하 컴포넌트</h4>
    </>
  )
};

export default Gather;
